        flexDirection="row"
        alignItems="center"
      >
        <Grid w="100%" paddingLeft="100px">
          <Text fontWeight="bold">Burger</Text> <Text>kenzie</Text>
        </Grid>

        <Input placeholder="e-mail" />
        <Input placeholder="Senha" type="password" />
      </Flex>
    </Flex>
  );
};
